5	Je m'appelle Yann Willy Jordan Pokam Teguia et je suis un jeune diplômé en techniques de l'informatique au Cégep de Chicoutimi. Je suis passionné d'informatique et de tous ses aspects qui mettent en jeu la logique, le raisonnement poussé et les défis en tout genre. C'est d'ailleurs pourquoi j'ai élaboré mon CV sous forme électronique en intégrant un chatbot boosté à l'IA qui pourrait me représenter devant un employeur, premièrement pour démontrer mes réelles compétences techniques, mais aussi pour donner la possibilité à ce dernier d'avoir un aperçu du type d'employé que je peux être en donnant au mieux les armes nécessaires au chatbot pour le faire.	[0.031339526,0.05329851,-0.034537435,0.117683105,0.023024956,0.011512478,-0.038161732,-0.02675585,-0.03389785,0.040506866,0.017588507,0.015243373,-0.07888179,-0.036669374,-0.041359644,-0.014923582,-0.018547881,0.042425614,0.0075150896,0.035603404,-0.007035403,-0.022811761,-0.0250503,0.0104465075,0.0021719143,0.010872896,-0.011725672,-0.028141612,-0.0028781195,-0.018761074,-0.028141612,0.007035403,0.02110621,-0.004530373,0.015243373,-0.012418552,-0.01684233,-0.0104465075,-0.038374927,0.017055523,-0.046476297,-0.013058134,0.008261269,0.044131167,0.0104465075,0.017588507,-0.060120717,0.03688257,-0.044770747,0.025583286,-0.0063958215,0.03752215,0.05393809,-0.04434436,0.025156897,-0.023131553,-0.00068621826,0.0018521232,0.041999225,0.06139988,0.054577675,-0.058841553,-0.046689495,-0.04434436,0.0784554,0.028354807,-0.09465815,0.063105434,-0.026862448,0.0358166,0.005516396,0.040293675,0.04541033,-0.08314567,0.0013990859,0.0038907912,0.027182238,-0.0049034627,-0.03112633,0.06353182,0.012951537,-0.03688257,-0.0077815824,0.029207582,-0.02963397,-0.013751015,-0.04114645,-0.012898239,0.008048075,-0.00014657089,-0.03858812,-0.074191526,0.023664538,-0.020786418,-0.010180015,-0.037308954,0.008421165,-0.04178603,0.019187463,0.0061293286,0.013324628,-0.04796866,0.02387773,-0.042852003,-0.03176591,0.027715225,-0.03965409,-0.02387773,0.